import React from "react";

import "../index.css";
import Mapp from './Mapp'
import * as d3 from "d3";
import * as topojson from "topojson-client";
import { ComposableMap, Geographies, Geography } from "react-simple-maps";
import datum from '../finalmap.json'


function Map(props) {
  var width = 300,
  height = 300;
  return (



    <ComposableMap style={{width: "100%", height: "100vh", backgroundColor: "white"}}  projectionConfig = {{center:[-2, 55.4],rotation:[4.4,0,0],parallels:[50,60],scale: 3000}}>
    <Geographies geography={datum}>
      {({ geographies }) =>
        geographies
        .map((geo,index) => {


            return(
              <Geography fill={(index < 20) ? "#FF0000" : "#ffffff"} stroke='black' key={index} geography={geo} />
                )

          }


      )
      }
    </Geographies>
  </ComposableMap>
    // <Mapp></Mapp>

  );
}

export default Map;
